import './style.css';




function Skills(props) {

  return (



      <div className="skills">
        <h2>Front-End</h2>
        <ul>
          <li><span class="html5"></span><em>HTML</em></li>
          <li><span class="css3"></span><em>CSS</em></li>
          <li><span class="js"></span><em>Javascript</em></li>
        </ul>
        <h2>Frameworks</h2>
        <ul>
          <li><span class="reactjs"></span><em>React.js</em></li>
          <li><span class="nodejs"></span><em>Node.js</em></li>
        </ul>

      </div>
      


  )



}


export default Skills;
